import React, { useContext } from 'react';
import { StateContext } from '../../../context/context';
import c from './Order.module.scss';
export const Order = () => {
  const { state1 } = useContext(StateContext);

  return (
    <>
      <div className={c.wrapper}>
        <div className={c.order__container}>
          <h2 className={c.order__title}>Оформлення заказу</h2>
          <div className={c.order__form}>
            <div className={c.form__contact}>
              <span className={c.contact__title}></span>
              <div className={c.contact__inputs}>
                <input
                  type="text"
                  placeholder="Ім'я"
                  className={c.order__input}
                />
                <input
                  type="text"
                  placeholder="Призвище"
                  className={c.order__input}
                />
                <input
                  type="text"
                  placeholder="Ім'я"
                  className={c.order__input}
                />
                <input
                  type="text"
                  placeholder="Електронна форма"
                  className={c.order__input}
                />
              </div>
            </div>
          </div>
          <div className={c.order__view}></div>
          <div></div>
        </div>
      </div>
    </>
  );
};
